import logo from "./logo.svg";
import "./App.css";
import FormImport from "./view/FormImport";

import { Router, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Router path="/" element={<FormImport />} />
    </Routes>
  );
}

export default App;
